import React from 'react';

const DisplayConversation = ({ messages }) => {
  return (
    <div>
      {messages.map((message, index) => (
        <div key={index}>{message}</div> // Add key prop with unique value
      ))}
    </div>
  );
};

export default DisplayConversation;
